import "./tailwind.css";
import { Routes, Route } from "react-router-dom";

import Header from './components/Header'

function App() {
  return (
    <>
    <Header/>
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="about" element={<About />} />
      </Routes>
    </div>
    </>
  );
}

export default App;
